import React from 'react';


function zervant() {
  return (
    <div className="App">
      {/* Navigation bar */}
      <nav className="navbar">
        <ul className="navbar-items">
          <li><a href="#">ACCUEIL</a></li>
          <li><a href="#">CLIENTS</a></li>
          <li><a href="#">FACTURES</a></li>
        </ul>
      </nav>

      {/* Logo */}
      <div className="logo">
        <img src="https://www.freepik.com/free-photos-vectors/logo-design" alt="Logo" />
      </div>

      {/* Main content */}
      <main className="main">
        {/* Invoice sections */}
        <section className="invoice-section">
          <h2>Factures ouvertes</h2>
          <div className="invoices">
            {/* Invoice items */}
          </div>
          <button className="add-invoice-button">+</button>
        </section>

        <section className="invoice-section">
          <h2>Factures non échues</h2>
          <div className="invoices">
            {/* Invoice items */}
          </div>
        </section>

        <section className="invoice-section">
          <h2>Factures échues</h2>
          <div className="invoices">
            {/* Invoice items */}
          </div>
        </section>
      </main>
    </div>
  );
}

export default zervant;
